import p1_img from "./product_1.jfif";
import p2_img from "./product_2.jfif";
import p3_img from "./product_3.jfif";
import p4_img from "./product_4.jfif";

let product_data = [
  {
    id: 1,
    name: "Adidas Classic 3 Stripes T-Shirt",
    image: p1_img,
    discounted_price: 30,
    original_price: 60,
  },
  {
    id: 2,
    name: "Apple iPhone 15 Pro Max",
    image: p2_img,
    discounted_price: 1300,
    original_price: 1500,
  },
  {
    id: 3,
    name: "Kookaburra Cricket Ball",
    image: p3_img,
    discounted_price: 30,
    original_price: 50,
  },
  {
    id: 4,
    name: "Sony bravia A95L(XR-65A95L)",
    image: p4_img,
    discounted_price: 400,
    original_price: 500,
  },
];

export default product_data;
